import React from 'react';
import { useNavigate } from 'react-router-dom';
import Rankings from './home_widgets/Rankings';
import UpcomingSeries from './home_widgets/UpcomingSeries.js';
import LiveMatches from './home_widgets/LiveMatches.js';
import './css/Home.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <div className="home-section">
        <LiveMatches navigate={navigate} />
        <Rankings />
      </div>

      <div className="side-widgets">
        <UpcomingSeries />
      </div>
    </div>
  );
};

export default Home;
